export default function SettingsPage()
{

    const {dentistId} = useParams();

    return (
    <div>
        <SideBar id={dentistId}/> 
        <main>
        <div className="centered-container">
              <div style={{ height:"100%", marginTop:"2%", backgroundColor:"#8DDFCB", borderRadius: "25px", padding:"10px 30px"}}>
                
                <h2 style={{textAlign:"center", paddingLeft:"20px",paddingRight:"20px",paddingTop:"10px", color:"black"}}>PatientForm</h2>
            </div>
        </div>
        </main>
    </div>)
}
